import { ReactFlowProvider, ReactFlow } from "reactflow";
import { nodes, edges } from "./MockData";
import { rackA, dbNodes, visibleEdges, onNodeClick  } from "./MockData";

function LapMap(){
    return(
        <ReactFlowProvider>
            <div style={{height: "90vh"}}>
                <ReactFlow
                    nodes={[...rackA, ...dbNodes]}
                    edges={visibleEdges}
                    onNodeClick={onNodeClick}
                    fitView
                />

            </div>
        </ReactFlowProvider>
    )

}

export default LapMap;
